import React, { Fragment } from 'react';

const DeleteButton = (props) => {
  return (
    <Fragment>
      <svg src={props.svgSrc} />
      <img src={props.imgSrc} alt="Delete" />
    </Fragment>
  );
};

export default DeleteButton;
